import './Chart1.css';
import { VictoryChart, VictoryBar, VictoryAxis, VictoryTheme } from 'victory';


function Chart1({resultList, jobList}){
    const quarterArray = [1,2,3,4];

    const data = resultList.map((earings,index)=>({
    salary : earings,
    job : jobList[index]
    }))

    return (
        <VictoryChart theme={VictoryTheme.grayscale} domainPadding={25}>
        <VictoryAxis
            // X ekseni etiketlerini ayarla
            tickValues={quarterArray}
            tickFormat={jobList}
        />
        <VictoryAxis
            dependentAxis
            // Y ekseninin etiket aralığını ayarla
            tickFormat={(x) => `$${x*100}`}
        />
        <VictoryBar
            data={data}
            x="job"
            y="salary"
            style={{
            data: { fill: "black" }
            }}
        />
        </VictoryChart>
    );
    };

export default Chart1;
